import React from 'react';

// ChapterContent Component
const ChapterContent = ({ title, description, link, rating }) => {
  return (
    <div className="chapter-content">
      <h2>{title}</h2>
      <p>{description}</p>
      <a href={link} target="_blank" rel="noopener noreferrer">Read More</a>
      <p>Rating: {rating}</p>
    </div>
  );
};

// Sample usage of ChapterContent Component
const App = () => {
  const chapter = {
    title: "Understanding React",
    description: "A comprehensive guide to learning React and its ecosystem.",
    link: "https://reactjs.org/docs/getting-started.html",
    rating: 4.5
  };

  return (
    <div className="app">
      <h1>Chapter Overview</h1>
      <ChapterContent 
        title={chapter.title} 
        description={chapter.description} 
        link={chapter.link} 
        rating={chapter.rating} 
      />
    </div>
  );
};

export default App;
